import React from 'react';
import { AlertTriangle, Info, CheckCircle, XCircle } from 'lucide-react';
import LoadingSpinner from './LoadingSpinner';

interface Insight {
  id: string;
  title: string;
  description: string;
  level: 'critical' | 'warning' | 'info' | 'success';
  metric_type: string;
  component: string;
  timestamp: string;
  recommendations: string[];
  critical_timestamp?: string;
  critical_value?: number;
}

interface InsightsCardProps {
  title: string;
  insights: Insight[];
  loading: boolean;
}

const InsightsCard: React.FC<InsightsCardProps> = ({ title, insights, loading }) => {
  const formatTimestamp = (timestamp: string) => {
    try {
      const date = new Date(timestamp);
      if (isNaN(date.getTime())) {
        return timestamp; // Return original if parsing fails
      }
      return date.toLocaleString('en-US', {
        month: '2-digit',
        day: '2-digit',
        year: 'numeric',
        hour: '2-digit',
        minute: '2-digit',
        second: '2-digit',
        hour12: false
      });
    } catch (error) {
      return timestamp; // Return original if formatting fails
    }
  };

  const getLevelIcon = (level: string) => {
    switch (level) {
      case 'critical':
        return <XCircle className="h-5 w-5 text-red-500" />;
      case 'warning':
        return <AlertTriangle className="h-5 w-5 text-yellow-500" />;
      case 'success':
        return <CheckCircle className="h-5 w-5 text-green-500" />;
      default:
        return <Info className="h-5 w-5 text-blue-500" />;
    }
  };

  const getLevelColor = (level: string) => {
    switch (level) {
      case 'critical':
        return 'border-red-200 bg-red-50';
      case 'warning':
        return 'border-yellow-200 bg-yellow-50';
      case 'success':
        return 'border-green-200 bg-green-50';
      default:
        return 'border-blue-200 bg-blue-50';
    }
  };

  if (loading) {
    return (
      <div className="bg-white overflow-hidden shadow rounded-lg">
        <div className="px-4 py-5 sm:p-6">
          <div className="flex items-center justify-center h-32">
            <LoadingSpinner />
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="bg-white overflow-hidden shadow rounded-lg">
      <div className="px-4 py-5 sm:p-6">
        <h3 className="text-lg leading-6 font-medium text-gray-900 mb-4">
          {title}
        </h3>
        
        {insights.length === 0 ? (
          <div className="text-center py-8">
            <CheckCircle className="mx-auto h-12 w-12 text-green-400" />
            <h3 className="mt-2 text-sm font-medium text-gray-900">No issues detected</h3>
            <p className="mt-1 text-sm text-gray-500">
              Your hardware is performing well within normal parameters.
            </p>
          </div>
        ) : (
          <div className="space-y-4">
            {insights.slice(0, 5).map((insight) => (
              <div
                key={insight.id}
                className={`border rounded-lg p-4 ${getLevelColor(insight.level)}`}
              >
                <div className="flex items-start">
                  <div className="flex-shrink-0">
                    {getLevelIcon(insight.level)}
                  </div>
                  <div className="ml-3 flex-1">
                    <h4 className="text-sm font-medium text-gray-900">
                      {insight.title}
                    </h4>
                    <p className="mt-1 text-sm text-gray-600">
                      {insight.description}
                      {insight.critical_timestamp && insight.critical_value && (
                        <span className="block mt-1 text-xs text-red-700 font-medium">
                          üìä Peak value: {insight.critical_value.toFixed(1)} at {insight.critical_timestamp}
                        </span>
                      )}
                    </p>
                    {insight.recommendations && insight.recommendations.length > 0 && (
                      <div className="mt-3">
                        <h5 className="text-xs font-medium text-gray-700 uppercase tracking-wide">
                          Recommendations:
                        </h5>
                        <ul className="mt-1 text-sm text-gray-600 space-y-1">
                          {insight.recommendations.slice(0, 2).map((rec, index) => (
                            <li key={index} className="flex items-start">
                              <span className="text-gray-400 mr-2">‚Ä¢</span>
                              {rec}
                            </li>
                          ))}
                        </ul>
                      </div>
                    )}
                    <div className="mt-2 text-xs text-gray-500">
                      {insight.metric_type.replace(/_/g, ' ').replace(/\b\w/g, l => l.toUpperCase())} ‚Ä¢ {insight.component}
                      {insight.critical_timestamp && (
                        <div className="mt-1 text-xs text-red-600 font-medium">
                          ‚ö†Ô∏è Critical event occurred at: {formatTimestamp(insight.critical_timestamp)}
                        </div>
                      )}
                    </div>
                  </div>
                </div>
              </div>
            ))}
            
            {insights.length > 5 && (
              <div className="text-center pt-2">
                <span className="text-sm text-gray-500">
                  Showing 5 of {insights.length} insights
                </span>
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
};

export default InsightsCard;
